script: |
  super -f text -I q8111.spq | sort > q8111.out

inputs:
  - name: q8111.spq
    data: |
      SELECT DISTINCT + - col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + ( CAST ( NULL AS INTEGER ) ) BETWEEN - col1 AND - col0 * + 75 * - 98 * - + col2 * col1 / - CAST ( + col0 AS REAL );
  - name: tab2

outputs:
  - name: q8111.out
    data: |
